import React from 'react';

export default function CircleMenu() {
  return (
    <div className="circle-menu-box">
      <i className="close fas fa-times"></i>
      <i className="minimize fas fa-minus"></i>
      <i className="expand far fa-expand"></i>
    </div>
  );
}
